import './Benefits.css';
import spaInterior from '../../../assets/spa-interior.png';
import anna from '../../../assets/anna-headshot.png';

const Benefits = () => {
  return (
    <div className="py-20" style={{ backgroundColor: '#F3EFEB' }}>
      <div className="mx-auto grid place-items-center" style={{ maxWidth: '1550px' }}>
        <div
          className="w-full lg:flex flex-reverse bg-white relative"
          style={{ backgroundColor: '#F3EFEB' }}>
          <div className="p-6 lg:p-0 lg:w-full grid place-items-center">what is this</div>
          <div className="lg:block hidden" style={{ width: '600px' }}>
            <img src={spaInterior} alt="" className="absolute" />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Benefits;
